import React from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import { useNavigate } from 'react-router-dom';

const CheckoutPage = () => {
  const navigate = useNavigate();

  const formik = useFormik({
    initialValues: {
      firstName: '',
      lastName: '',
      email: '',
      phone: '',
      address: ''
    },
    validationSchema: Yup.object({
      firstName: Yup.string().required('First name is required'),
      lastName: Yup.string().required('Last name is required'),
      email: Yup.string().email('Invalid email format').required('Email is required'),
      phone: Yup.string()
        .matches(/^\d+$/, 'Phone number must be a number')
        .required('Phone number is required'),
      address: Yup.string().required('Address is required')
    }),
    onSubmit: () => {
      // After successful submission, navigate to the Success page
      navigate('/success');
    }
  });

  return (
    <div className="checkout-container">
      <h1>Checkout</h1>
      <form onSubmit={formik.handleSubmit}>
        <div className="form-field">
          <label>First Name</label>
          <input
            type="text"
            {...formik.getFieldProps('firstName')}
            className={formik.touched.firstName && formik.errors.firstName ? 'error' : ''}
          />
          {formik.touched.firstName && formik.errors.firstName ? (
            <div className="error-message">{formik.errors.firstName}</div>
          ) : null}
        </div>

        <div className="form-field">
          <label>Last Name</label>
          <input
            type="text"
            {...formik.getFieldProps('lastName')}
            className={formik.touched.lastName && formik.errors.lastName ? 'error' : ''}
          />
          {formik.touched.lastName && formik.errors.lastName ? (
            <div className="error-message">{formik.errors.lastName}</div>
          ) : null}
        </div>

        <div className="form-field">
          <label>Email</label>
          <input
            type="email"
            {...formik.getFieldProps('email')}
            className={formik.touched.email && formik.errors.email ? 'error' : ''}
          />
          {formik.touched.email && formik.errors.email ? (
            <div className="error-message">{formik.errors.email}</div>
          ) : null}
        </div>

        <div className="form-field">
          <label>Phone</label>
          <input
            type="text"
            {...formik.getFieldProps('phone')}
            className={formik.touched.phone && formik.errors.phone ? 'error' : ''}
          />
          {formik.touched.phone && formik.errors.phone ? (
            <div className="error-message">{formik.errors.phone}</div>
          ) : null}
        </div>

        <div className="form-field">
          <label>Address</label>
          <input
            type="text"
            {...formik.getFieldProps('address')}
            className={formik.touched.address && formik.errors.address ? 'error' : ''}
          />
          {formik.touched.address && formik.errors.address ? (
            <div className="error-message">{formik.errors.address}</div>
          ) : null}
        </div>

        {Object.keys(formik.errors).length > 0 && (
          <div className="error-summary">
            <p>Oh snap! Change a few things up and try submitting again.</p>
          </div>
        )}

        <button type="submit" className="continue-button">Continue</button>
      </form>
    </div>
  );
};

export default CheckoutPage;
